// ==UserScript==
// @name           Tumbeast Hunting
// @namespace      http://userscripts.org/users/113977
// @description    Shoot the tumbeasts on Tumblr
// @include        http://www.tumblr.com/*
// @version        0.0.1
// @date           2011-03-24
// @creator        Jeremy Cutler
// ==/UserScript==

var tumbeasts = document.getElementById('tumbeasts_503_container');
if (tumbeasts) {
   var snd = 'data:audio/wav;base64,';
   var bulletimg = 'data:image/png;base64,';

   var bullets = [{x:0, y:0, w:55, h:55},
                  {x:0, y:-55, w:34, h:35},
                  {x:0, y:-90, w:77, h:79}];

   var i;
   var shots = [];
   var rules = "";
   var st = document.createElement('style');
   st.setAttribute('type','text/css');
   rules = 'div.bullet_hole { position:absolute; background:url("' + bulletimg + '") no-repeat scroll center center; } ';
   for (i=0; i<bullets.length; i++) {
      rules += 'div.bullet' + i + ' { background-position:' + bullets[i].x + 'px ' + bullets[i].y + 'px; ' +
                                 'width:' + bullets[i].w + 'px; height:' + bullets[i].h + 'px; }';
   }
   st.innerHTML = rules;
   document.getElementsByTagName('head')[0].appendChild(st);
   
   var au = document.createElement('audio');
   au.setAttribute('id','audio_gunshot');
   au.setAttribute('type','audio.wav');
   au.setAttribute('src',snd);
   document.body.appendChild(au);

   var tum = tumbeasts.getElementsByTagName('div');
   for (i=0; i<tum.length; i++) {
      if (tum[i].className === "tumbeasts_image") {
         break;
      }
   }
   if (i >= tum.length) {
      tum = null;
   }
   else {
      tum = tum[i];
   }
   if (tum) {
      tum.addEventListener('click', function(e) {
         var i;
         var num = Math.floor(Math.random()*bullets.length);

         if (shots.length === 10) {
            var shot = shots.shift();
            shot.parentNode.removeChild(shot);
         }
         au.load(); 
         au.play();
         var shot = document.createElement('div');
         shot.className = 'bullet_hole bullet' + num;
         shot.style.left = (e.pageX - bullets[num].w/2) + 'px';
         shot.style.top = (e.pageY - bullets[num].h/2) + 'px';
         document.body.appendChild(shot);
         shots.push(shot);
      }, false);
   }
}
